import React from 'react';
import { Link } from 'react-router-dom';

function Navbar({ isLoggedIn, onLogin, onLogout }) {
  return (
    <nav className="navbar">
      <div className="container">
        <Link to="/" className="navbar-brand">Mon Application</Link>
        <ul className="navbar-nav">
          <li className="nav-item">
            <Link to="/" className="nav-link">Accueil</Link>
          </li>
          <li className="nav-item">
            <Link to="/wilaya" className="nav-link">Wilaya</Link>
          </li>
          {!isLoggedIn ? (
            <li className="nav-item">
              <button className="btn btn-primary" onClick={onLogin}>Se connecter</button>
            </li>
          ) : (
            <li className="nav-item">
              <button className="btn btn-danger" onClick={onLogout}>Se d√©connecter</button>
            </li>
          )}
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
